import React from "react";
import project_pitch from "./static_files/project_pitch.pdf";
import midpoint_update from "./static_files/midpoint_update.pdf";

function About() {
  return (
    <div className="about">
      <div className="container">
        <div className="row align-items-center my-5">
          <div className="">
            <h1 className="font-weight-light">About</h1>
            <p>
              Professor Marvin was developed for EECS 449 (Conversational AI) @ UMich
            </p>
            <section>
              <p>
                Check out the presentations below to see how the project evolved over the course of the semester
              </p>
              <ul>
                <li><a href={project_pitch} target="_blank">Project Pitch</a></li>
                <li><a href={midpoint_update} target="_blank">Midpoint Update</a></li>
                <li><a target="_blank">Final Presentation</a></li>
              </ul>
            </section>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
